import React, { Component } from "react";
import DroneList from "./DroneList";
import SearchBar from "./SearchBar";
// import Navbar from './Navbar'


class MainContainer extends Component {

    state = {
        drones: []
      }


    componentDidMount(){
      //function from react library


      fetch('http://localhost:3000/drones')
      .then(res => res.json())
      .then(drones => {
        this.setState({
          drones: drones  
        })
        // console.log(drones)
      })
    }


    render(){
    return (
      <div className="App" >
       <h1>Welcome to DroneShareShip!</h1>
       <DroneList title="Drones Available" drones={this.state.drones}/>
       <SearchBar/>

      </div>
      ) 
    }
  }

  export default MainContainer
